    active_lock_reason: null,
    body: "When using multiple nested React roots, un-mounting the top-level one does not result in un-mounting lower-level ones. Any `useEffect` cleanup functions of components in lower-level roots are not called.\r\n\r\nReact version: 18.2.0 (also reproduced in 17.0.2)\r\n\r\n## Steps To Reproduce\r\n\r\n*see code examples for details*\r\n\r\n1. Create React root using `createRoot`.\r\n2. Inside this root create another root.\r\n3. In the nested root add component with `useEffect` hook which has cleanup function that prints something to a console.\r\n4. Unmount top-level root.\r\n5. Nothing is printed to a console - nested root was not properly unmounted.\r\n\r\nLink to code example:\r\n\r\nReproduction in React 18.2.0: https://codesandbox.io/s/react-17-nested-micro-apps-l8mdp8?file=/src/index.js\r\nReproduction in React 17.0.2 (using old `ReactDOM.render` and `ReactDOM.unmountComponentAtNode` API): https://codesandbox.io/s/react-17-nested-micro-apps-l8mdp8?file=/src/index.js\r\n\r\n## The current behavior\r\n\r\nNested roots are not properly unmounted.\r\n\r\n## The expected behavior\r\n\r\nNested roots should be properly unmounted.\r\n",
