    author_association: "NONE",
    active_lock_reason: null,
    body: "<!--\r\n  Please provide a clear and concise description of what the bug is. Include\r\n  screenshots if needed. Please test using the latest version of the relevant\r\n  React packages to make sure your issue has not already been fixed.\r\n-->\r\n\r\nI had a test using `jest.FakeTimers` where the results were different between React 17 and 18.\r\n\r\nIn React 17, useEffect was called each time the state was updated during setInterval, but in React 18, useEffect is no longer executed each time.\r\n\r\nhttps://github.com/facebook/react/commit/06f7b4f43a93eae9111cfbd972ab1ae1148f6afb. The behavior seemed to have changed since this commit.\r\n\r\n\r\nReact version: 17, 18\r\n\r\n## Steps To Reproduce\r\n\r\n<!--\r\n  Your bug will get fixed much faster if we can run your code and it doesn't\r\n  have dependencies other than React. Issues without reproduction steps or\r\n  code examples may be immediately closed as not actionable.\r\n-->\r\n\r\n<details>\r\n<summary>Expand reproduce code</summary>\r\n\r\n```ts\r\nimport { useEffect, useState } from \"react\";\r\n\r\nexport let count = 0;\r\nexport function useHooks() {\r\n  const [a, setA] = useState(0);\r\n  const [b, setB] = useState(0);\r\n\r\n  useEffect(() => {\r\n    const id = setInterval(() => {\r\n      console.log(\"interval\");\r\n      setA((v) => v + 1);\r\n    }, 100);\r\n    return () => clearInterval(id);\r\n  }, []);\r\n\r\n  useEffect(() => {\r\n    count = a;\r\n    setB((v) => v + 1);\r\n    console.log({ count });\r\n  }, [a]);\r\n\r\n  return b;\r\n}\r\n```\r\n\r\n```ts\r\nlet TestRenderer;\r\nlet React;\r\nlet target;\r\nlet act;\r\n\r\nbeforeAll(() => {\r\n  jest.useFakeTimers();\r\n  TestRenderer = require('react-test-renderer');\r\n  React = require('react');\r\n  target = require('./hooks');\r\n  act = TestRenderer.act;\r\n});\r\n\r\nit('', () => {\r\n  const result = renderHook(target.useHooks);\r\n\r\n  act(() => {\r\n    jest.advanceTimersByTime(0);\r\n  });\r\n  expect(target.count).toBe(0);\r\n\r\n  act(() => {\r\n    jest.advanceTimersByTime(500);\r\n  });\r\n\r\n  expect(target.count).toBe(5);\r\n  expect(result.current).toBe(6);\r\n});\r\n\r\nfunction renderHook(cb) {\r\n  const result = React.createRef();\r\n\r\n  function Component() {\r\n    const renderResult = cb();\r\n\r\n    React.useEffect(() => {\r\n      result.current = renderResult;\r\n    });\r\n    return null;\r\n  }\r\n\r\n  TestRenderer.create(<Component />);\r\n  return result;\r\n}\r\n```\r\n\r\n</details>\r\n\r\nLink to code example:\r\n\r\n<!--\r\n  Please provide a CodeSandbox (https://codesandbox.io/s/new), a link to a\r\n  repository on GitHub, or provide a minimal code example that reproduces the\r\n  problem. You may provide a screenshot of the application if you think it is\r\n  relevant to your bug report. Here are some tips for providing a minimal\r\n  example: https://stackoverflow.com/help/mcve.\r\n-->\r\nReact 17: https://codesandbox.io/p/sandbox/test-issue-repro-react17-mus0c8\r\nReact 18: https://codesandbox.io/p/sandbox/test-issue-repro-react18-wlrskc\r\n\r\n## The current behavior (React 18)\r\n\r\n```\r\n console.log\r\n    { count: 0 }\r\n      at src/hooks.js:19:13\r\n\r\n  console.log\r\n    interval\r\n      at src/hooks.js:10:15\r\n\r\n  console.log\r\n    interval\r\n      at src/hooks.js:10:15\r\n\r\n  console.log\r\n    interval\r\n      at src/hooks.js:10:15\r\n\r\n  console.log\r\n    interval\r\n      at src/hooks.js:10:15\r\n\r\n  console.log\r\n    interval\r\n      at src/hooks.js:10:15\r\n\r\n  console.log\r\n    { count: 5 }\r\n      at src/hooks.js:19:13\r\n```\r\n\r\n## The expected behavior (React 17)\r\n\r\n```\r\n console.log\r\n    { count: 0 }\r\n      at src/hooks.js:19:13\r\n\r\n  console.log\r\n    interval\r\n      at src/hooks.js:10:15\r\n\r\n  console.log\r\n    { count: 1 }\r\n      at src/hooks.js:19:13\r\n\r\n  console.log\r\n    interval\r\n      at src/hooks.js:10:15\r\n\r\n  console.log\r\n    { count: 2 }\r\n      at src/hooks.js:19:13\r\n\r\n  console.log\r\n    interval\r\n      at src/hooks.js:10:15\r\n\r\n  console.log\r\n    { count: 3 }\r\n      at src/hooks.js:19:13\r\n\r\n  console.log\r\n    interval\r\n      at src/hooks.js:10:15\r\n\r\n  console.log\r\n    { count: 4 }\r\n      at src/hooks.js:19:13\r\n\r\n  console.log\r\n    interval\r\n      at src/hooks.js:10:15\r\n\r\n  console.log\r\n    { count: 5 }\r\n      at src/hooks.js:19:13\r\n```\r\n\r\n## Links\r\n\r\n- https://reactjs.org/blog/2022/03/29/react-v18.html#new-feature-automatic-batching\r\n  - https://github.com/facebook/react/issues/26273#issuecomment-1451229823\r\n- https://github.com/reactwg/react-18/discussions/21\r\n- https://github.com/reactwg/react-18/discussions/23\r\n- https://github.com/reactwg/react-18/discussions/102\r\n- https://github.com/facebook/react/issues/25046",
